import './App.css';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route element={<Navigate to='/homepage' />} path='/'/>
          <Route element={<Home />}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
